import React from 'react'



export default function ChangeImg() {
  return (
    <div className='changeImg'>
      <div></div>
      <div></div>
      <div className='operation' style={{display:'flex',justifyContent:'center'}}>
        <div >上传</div>
        <div>取消</div>
      </div>
    </div>
  )
}
